import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class CCr extends Component {
        constructor(props) {
          super(props);
          this.state = { 
            TIMIscore: 0
         };
        }

    changeTIMI = () => {
                this.setState(state => ({ 
                    TIMIscore:2
                }))
        }; 

    render() {
        return (
            <div>
                <h2>TIMI Score for UA/NSTEMI</h2>
                <input type="checkbox" value="age>=65" onChange={this.changeTIMI} /> age>=65<a>&nbsp;&nbsp;</a>
                <input type="checkbox" value="female" onChange={this.changeTIMI}/> >=3 CAD risk factors<a>&nbsp;&nbsp;</a>
                <input type="checkbox" value="female" onChange={this.changeTIMI}/> known CAD(stenosis>=50%)<a>&nbsp;&nbsp;</a>
                <input type="checkbox" value="female" onChange={this.changeTIMI}/> ASA use in past 7 days<a>&nbsp;&nbsp;</a>
                <input type="checkbox" value="female" onChange={this.changeTIMI}/> Severe angina (≥2 episodes in 24 hrs)<a>&nbsp;&nbsp;</a>
                <input type="checkbox" value="female" onChange={this.changeTIMI}/> EKG ST changes ≥0.5mm<a>&nbsp;&nbsp;</a>
                <input type="checkbox" value="female" onChange={this.changeTIMI}/> Positive cardiac marker<a>&nbsp;&nbsp;</a>
               <span>
                    <button onClick={this.handleIncCCr}>calculate</button>
                </span>
                <h3>Score: {this.state.TIMIscore}</h3>
            </div>
        );
    }
}
